define("ckeditor/plugins/a11yhelp/lang/cs",["dijit","dojo","dojox"],function(){CKEDITOR.plugins.setLang("a11yhelp","cs",{accessibilityHelp:{title:"Instrukce pro p\u0159\u00edstupnost",contents:"Obsah n\u00e1pov\u011bdy. Pro uzav\u0159en\u00ed tohoto dialogu stiskn\u011bte kl\u00e1vesu ESC.",legend:[{name:"Obecn\u00e9",items:[{name:"Panel n\u00e1stroj\u016f editoru",legend:"Stiskn\u011bte${toolbarFocus} k proch\u00e1zen\u00ed panelu n\u00e1stroj\u016f. P\u0159ejd\u011bte na dal\u0161\u00ed a p\u0159edchoz\u00ed skupiny pomoc\u00ed TAB a SHIFT-TAB. P\u0159echod na dal\u0161\u00ed a p\u0159edchoz\u00ed tla\u010d\u00edtko panelu n\u00e1stroj\u016f je pomoc\u00ed \u0160IPKA VPRAVO nebo \u0160IPKA VLEVO. Stisknut\u00edm mezern\u00edku nebo kl\u00e1vesy ENTER tla\u010d\u00edtko aktivujete."},
{name:"Dialogov\u00e9 okno editoru",legend:"Uvnit\u0159 dialogov\u00e9ho okna stiskn\u011bte TAB pro p\u0159esunut\u00ed na dal\u0161\u00ed pole, stiskn\u011bte SHIFT + TAB pro p\u0159esun na p\u0159edchoz\u00ed pole, stiskn\u011bte ENTER pro odesl\u00e1n\u00ed dialogu, stiskn\u011bte ESC pro jeho zru\u0161en\u00ed. Pro dialogov\u00e1 okna, kter\u00e1 maj\u00ed mnoho karet stiskn\u011bte ALT + F10 pr oproch\u00e1zen\u00ed seznamu karet. Pak se p\u0159esu\u0148te na dal\u0161\u00ed kartu pomoc\u00ed TAB nebo \u0160IPKA VPRAVO. Pro p\u0159esun na p\u0159edchoz\u00ed stiskn\u011bte SHIFT + TAB nebo \u0160IPKA VLEVO. Stiskn\u011bte MEZERN\u00cdK nebo ENTER pro vybr\u00e1n\u00ed str\u00e1nky karet."},
{name:"Kontextov\u00e9 menu editoru",legend:"Stiskn\u011bte ${contextMenu} nebo kl\u00e1vesu APPLICATION k otev\u0159en\u00ed kontextov\u00e9ho menu. Pak se p\u0159esu\u0148te na dal\u0161\u00ed mo\u017enost menu pomoc\u00ed TAB nebo \u0160IPKY DOL\u016e. P\u0159esu\u0148te se na p\u0159edchoz\u00ed mo\u017enost pomoc\u00ed  SHIFT+TAB nebo \u0160IPKY NAHORU. Stiskn\u011bte MEZERN\u00cdK nebo ENTER pro zvolen\u00ed mo\u017enosti menu. Podmenu sou\u010dasn\u00e9 mo\u017enosti otev\u0159ete pomoc\u00ed MEZERN\u00cdKU nebo ENTER \u010di \u0160IPKY DOLEVA. Kontextov\u00e9 menu uzav\u0159ete stiskem ESC."},
{name:"R\u00e1me\u010dek seznamu editoru",legend:"Uvnit\u0159 r\u00e1me\u010dku seznamu se p\u0159esunete na dal\u0161\u00ed polo\u017eku menu pomoc\u00ed TAB nebo \u0160IPKA DOL\u016e. Na p\u0159edchoz\u00ed polo\u017eku se p\u0159esunete SHIFT + TAB nebo \u0160IPKA NAHORU. Stiskn\u011bte MEZERN\u00cdK nebo ENTER pro zvolen\u00ed mo\u017enosti seznamu. Stiskn\u011bte ESC pro uzav\u0159en\u00ed seznamu."},{name:"Li\u0161ta cesty prvku v editoru",legend:"Stiskn\u011bte ${elementsPathFocus} pro proch\u00e1zen\u00ed li\u0161ty cesty prvku. Na dal\u0161\u00ed tla\u010d\u00edtko prvku se p\u0159esunete pomoc\u00ed TAB nebo \u0160IPKA VPRAVO. Na p\u0159edchoz\u00ed polo\u017eku se p\u0159esunete pomoc\u00ed SHIFT + TAB nebo \u0160IPKA VLEVO. Stiskn\u011bte MEZERN\u00cdK nebo ENTER pro vybr\u00e1n\u00ed prvku v editoru."}]},
{name:"P\u0159\u00edkazy",items:[{name:" P\u0159\u00edkaz Zp\u011bt",legend:"Stiskn\u011bte ${undo}"},{name:" P\u0159\u00edkaz Znovu",legend:"Stiskn\u011bte ${redo}"},{name:" P\u0159\u00edkaz Tu\u010dn\u00e9",legend:"Stiskn\u011bte ${bold}"},{name:" P\u0159\u00edkaz Kurz\u00edva",legend:"Stiskn\u011bte ${italic}"},{name:" P\u0159\u00edkaz Podtr\u017een\u00ed",legend:"Stiskn\u011bte ${underline}"},{name:" P\u0159\u00edkaz Odkaz",legend:"Stiskn\u011bte ${link}"},{name:" P\u0159\u00edkaz Skr\u00fdt panel n\u00e1stroj\u016f",
legend:"Stiskn\u011bte ${toolbarCollapse}"},{name:" N\u00e1pov\u011bda p\u0159\u00edstupnosti",legend:"Stiskn\u011bte ${a11yHelp}"}]}]}})});